import { 
  Frame,
  TodoList
} from '../components';

interface CompletedScreenProps {
  [x: string]: any
}

export const CompletedScreen: React.FC<CompletedScreenProps> = ({ children, ...props }) => {
  return (
    <Frame scroll>
      <TodoList
        completed
      />
    </Frame>
  );
}
